import {Helmet} from 'react-helmet';
import 'bootstrap/dist/css/bootstrap.min.css';
import {Row, Col} from 'react-bootstrap';

function App() {
	return (
	<div className="App">
		<Helmet>
			<title> Stoepplantjes </title>
		</Helmet>
		<div className="header">
			<Row>
				<Col md={4} lg={8} style={{background:red}}>
					<div className="logo">
						<h1> Logo</h1>
					</div>
				</Col>
				<Col md={6} lg={8}>
					<div className="title">
						<h1> Stoepplantjes </h1>
					</div>
				</Col>
			</Row>
		</div>

	</div>
	);
}

export default App;
